function submit(n){if(n.preventDefault(),$("#EditProduct").valid()){$("#EditProduct input[type='submit']").prop("disabled",!0).addClass("d-none");let n=$("#LoadingSpinner");n.removeClass("d-none");fetch(apiUrls.adminEditProduct,{method:"POST",body:new FormData(form)}).then(n=>n.json()).then(t=>{n.addClass("d-none"),window.setTimeout(()=>{window.location.href=t.redirectUrl},1e3)})}}const form=document.getElementById("EditProduct");$(document).ready(()=>{$("#EditProduct").on("submit",submit);$("input[type=radio][name=Photo]").change(function(){this.value==1?$("#changePhoto").removeClass("d-none"):$("#changePhoto").addClass("d-none")})});